import React, { Component } from "react";
import UserDetail from "./UserDetail";

class User extends Component {
  constructor() {
    super();
    this.state = {
      fName: "Aysha",
      lName: "Marty",
      dob: "21/07/1992",
      city: "Salford"
    };
  }
  render() {
    return (
      <div>
        <p>This is the User Component</p>
        <h1>User</h1>
        <h3>
          {this.state.myUser.fName} {this.state.myUser.lName}
        </h3>

        <UserDetail userData={this.state.myUser} />
      </div>
    );
  }
}

export default User;
